  const handleUpdate = () => {
    refreshUser();
  };

  return (
    <div style={{ padding: '20px', maxWidth: '1200px', margin: '0 auto' }}>
      <h1 style={{ marginBottom: '30px', color: '#2c3e50' }}>KYC Verification</h1>
      {user && <KYCForm user={user} onUpdate={handleUpdate} />}
    </div>
  );
};

